import axios from 'axios';

// 直接返回对象
export const logIn = () => ({
  type: 'log'
})

export const getList = () => {
  return (dispatch) => {
    axios.get('/api/headerList.json').then((res) =>{
      console.log(res)
    }).catch(() => {
      console.log('error');
    })
  }
}
